    async def delete_message(self, bot: WechatAPIClient, message: dict, message_id: str):
        """ÈÄöËøáÊ∂àÊÅØidÂà†Èô§Ê∂àÊÅØ"""
        wxid = message["SenderWxid"]

        if not message_id:
            await bot.send_at_message(message["FromWxid"], "\n" + "ËØ∑ËæìÂÖ•Ë¶ÅÂà†Èô§ÁöÑÊ∂àÊÅØID", [message["SenderWxid"]])
            return

        # Âà†Èô§Â§áÂøòÂΩï
        is_ok = await self.db.delete(wxid=wxid, message_ids=[message_id])

        if is_ok:
            reply = f"{message_id}Â§áÂøòÂΩïÂà†Èô§ÊàêÂäü"
        else:
            reply = f"{message_id}Â§áÂøòÂΩïÂà†Èô§Â§±Ë¥•"
        
        logger.info(reply)

        if reply:
            await bot.send_at_message(message["FromWxid"], "\n" + reply, [message["SenderWxid"]])

